import Navbar from '../components/Navbar'
import Footer from '../components/Footer'


const Index = () =>(
    <div>
        <Navbar/>
        <img className="" src="/background1.jpg" alt="my image"></img>
        <Footer/>
    </div>
)

export default Index;
